int sumIndicesWithKSetBits(int* nums, int numsSize, int k){
    int sum = 0; // To store the sum of elements

    // Function to count set bits in an integer's binary representation
    int countSetBits(int n) {
        int count = 0;
        while (n) {
            count += n & 1; // Increment count if the last bit is set
            n >>= 1; // Right shift to check the next bit
        }
        return count;
    }

    // Iterate through the array
    for (int i = 0; i < numsSize; i++) {
        if (countSetBits(i) == k) { // Check if the index has exactly k set bits
            sum += nums[i]; // Add the corresponding element to sum
        }
    }

    return sum; // Return the sum of elements
}
